import React from 'react';
import './GreenBox.css';

const FormInputWithGreenHover = () => {
  return (
    <div className="form-container">
      <input type="text" className="input-field" placeholder="Enter text" />
    </div>
  );
};

export default FormInputWithGreenHover;
